import React from 'react';
import styles from './styles.module.scss';
import Button from '../../components/Button';

const buttons = [
  {
    name: 'Entry Free',
    icon: '...'
  },
  {
    name: 'Track #2',
    icon: '...'
  },
  {
    name: 'Track #2',
    icon: '...'
  },
  {
    name: 'Track #2',
    icon: '...'
  }
];

const Race = () => {
  return (
    <div>
      {buttons.map((button) => (
        <Button key={button.name} name={button.name} icon={button.icon} />
      ))}
    </div>
  );
};

export default Race;
